    <LinkContainer to={ '/' + props.PortfolioLink}>
      <Card.ImgOverlay />
    </LinkContainer>

    <Card.Body className="px-0">
      <h4>{props.Headline}</h4>
      <p>{props.Subheader}</p>
    </Card.Body>

  </Card>
  </Fade>
);

